import React from 'react';
// import logo from './logo.png';

function Navbar() {
  return (
    <nav>
      <div className="logo">
        {/* <img src={logo} alt="Logo" /> */}
      </div>
      <ul>
        <li><a href="#">Home</a></li>
        <li><a href="#">About</a></li>
        <li><a href="#">Services</a></li>
        <li><a href="#">Contact</a></li>
      </ul>
    </nav>
  );
}

export default Navbar;
